import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import PlayEditor from "./pages/PlayEditor";
import LoginPage from "./pages/LoginPage";  // if you kept it as LoginPage
import SignupPage from "./pages/SignupPage"; // optional if you have a separate signup modal/page

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/editor/:id" element={<PlayEditor />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />
      </Routes>
    </Router>
  );
}

export default App;
